import React, { Component } from 'react';
import { Layout, Menu, Icon} from 'antd';
import IconFont from '../../iconfont/font';
// ------Content内组件引入----
import Home from './Home/Home.js';
import './Person/Person'

let { Content} = Layout;
const SubMenu = Menu.SubMenu;

export default class Temp extends Component {
  constructor(){
    super()
   }
  render() {
    return (
  
        <Content 
        style={{padding: 20, background: '#fff', minHeight: 280,margin: "20px 0 0 16px"
      }}
        >
          
          <Router>
     <div>
        <Link to="/"><button>去首页</button> </Link>
        <Link to="/Home"><button>去home页</button> </Link>
        <Link to="/About"><button>去About页</button> </Link>
       <Route 
            path="/" 
            exact
            // strict
            // component如果放函数，一定要放有名的函数组件，不然会多次的挂载和卸载
            component={(props)=>{
                 return <App {...props}/>//传数据     
            }} />   
            {/* 最好使用render可以返回jsx或者一个组件,更喜欢通过render去判断使用需求的组件。 */}
        <Route 
            path="/Home" 
            render={(props)=>{
                return <Home {...props}/>
            }}    
        />   
        <Route 
            path="/About" 
            component={About} /> 
         
      </div>         
    </Router>

         <Home/>
        </Content>
    )
  }
}
